import React from "react";
import PropTypes from "prop-types";
import ThemeToggler from '../ThemeToggler';

const Header = ({theme, themeToggler}) => {
  return (
    // <search>
    // <light/dark>
    // <filter>
    <>
    <ThemeToggler theme={theme} toggleTheme={themeToggler} />
    <h1>Header</h1>
    </>
  )
};

Header.propTypes = {};

Header.defaultProps = {};

export default Header;
